import Trade from "./Trade";

const Trades = () => {
    const categories = [
        {
            categoryName: "Sedans",
            trades: [
                {
                    name: "Audi A5",
                    imageUrl: "../images/car1.jpg"
                },
                {
                    name: "Honda Accord",
                    imageUrl: "../images/car1.jpg"
                },
                {
                    name: "Toyota Camry",
                    imageUrl: "../images/car1.jpg"
                }
            ]
        },
        {
            categoryName: "SUVs",
            trades: [
                {
                    name: "Audi Q5",
                    imageUrl: "../images/car1.jpg"
                },
                {
                    name: "BMW X1",
                    imageUrl: "../images/car1.jpg"
                },
                {
                    name: "Mazda CX5",
                    imageUrl: "../images/car1.jpg"
                }
            ]
        }
    ];
    return ( 
        // <div className="row d-flex flex-row">
        //     <Trade tradeParams={"Hello"}/>
        // </div>
        <div className="container-fluid">
            {
                categories.map((c) => 
                    <div>
                        <h6>{c.categoryName}</h6>
                        {
                            c.trades.map(trade => {<Trade tradeDetails={trade}/>})
                        }
                    </div>
                )
            }
        </div>
    );
}

export default Trades;
